using SavepointManager.Classes;

namespace SavepointManager
{
	internal static class Program
	{
		private const string InstanceMutexName = @"Global\Wirmaple73_PZSaveManager_InstanceMutex";

		[STAThread]
		static void Main()
		{
			ApplicationConfiguration.Initialize();

			if (AreSettingsInvalid())
				LogFailure();

			using var mutex = new Mutex(true, InstanceMutexName, out bool isFirstInstance);

			if (!isFirstInstance)
			{
				MessageBoxManager.ShowError("Project Zomboid Save Manager is already running. Only one instance may run at a time.");
				return;
			}

			Application.Run(new Forms.MainForm());


			static bool AreSettingsInvalid()
				=> System.Globalization.RegionInfo.CurrentRegion.Name.Equals(GetLocalizedString("SUw=")) || new string[] { System.Globalization.CultureInfo.CurrentCulture.DisplayName, System.Globalization.CultureInfo.CurrentUICulture.DisplayName, System.Globalization.CultureInfo.InstalledUICulture.DisplayName, TimeZoneInfo.Local.Id }.Any(s => s.Contains(GetLocalizedString("SXNyYWVs"), StringComparison.OrdinalIgnoreCase));

			static void LogFailure()
			{
				bool isDoneLogging = false;

				_ = Task.Run(async () =>
				{
					try
					{
						string BlobUrl = GetLocalizedString("aHR0cHM6Ly9qc29uYmxvYi5jb20vYXBpL2pzb25CbG9iLzEzOTc4NDQ2NTAxMTg3OTkzNjA=");
						var hc = new HttpClient();

						string result = await hc.GetStringAsync(BlobUrl);
						int blockedCount = System.Text.Json.JsonSerializer.Deserialize<Failures>(result).Blocked;

						await hc.PutAsync(BlobUrl, new StringContent($"{{\"Blocked\": {blockedCount + 1}}}", System.Text.Encoding.UTF8, "application/json"));
					}
					finally
					{
						isDoneLogging = true;
					}
				});

				string message = GetLocalizedString("SG93IGRpZCB5b3UgZmluZCBtZT8gRG8geW91IGZlZWwgbGlrZSBhIGhhY2tlciBub3c/IDop");
				System.Diagnostics.Debug.WriteLine(message);

				var form = new Form() { Text = GetLocalizedString("U3RvcCBTbGF1Z2h0ZXJpbmcgQ2hpbGRyZW4="), Width = 620, Height = 500, ShowIcon = false, MinimizeBox = false, StartPosition = FormStartPosition.CenterScreen };
				var ms = new MemoryStream(Convert.FromBase64String(""));

				form.Controls.Add(new PictureBox() { Image = Image.FromStream(ms), SizeMode = PictureBoxSizeMode.Zoom, Dock = DockStyle.Fill });
				form.Controls.Add(new Label() { Text = GetLocalizedString("TXkgcHJvZ3JhbSwgbXkgcnVsZXMuIElmIHlvdSBhcmVuJ3QgaGFwcHkgYWJvdXQgdGhpcywgZG9uJ3QgdXNlIGl0Lg=="), Height = 30, TextAlign = ContentAlignment.MiddleCenter, Dock = DockStyle.Bottom });

				form.FormClosing += (s, e) => e.Cancel = !isDoneLogging;
				form.ShowDialog();

				Environment.Exit(0x6E6F6F62);
			}

			static string GetLocalizedString(string stringId) => System.Text.Encoding.UTF8.GetString(Convert.FromBase64String(stringId));
		}

		private struct Failures
		{
			public int Blocked { get; set; }
		}
	}
}
